import React from 'react';

import Chat from './components/Chat';
import Join from './components/Join';

function App() {
  const path = window.location.pathname;
  let content;
  switch(path){
    case '/':

    case '/chat':
      content = <Chat/>
      break;
    default:
      content = <Join/>
      break;
  }
  return (
    <div>
      {content}
    </div>
  );
}

export default App;
